import types from '@commitlint/config-angular-type-enum'
import fastGlobPkg from 'fast-glob'
import fsExtraPkg from 'fs-extra'
const {readJSONSync} = fsExtraPkg
const {sync: globSync} = fastGlobPkg

const packages = globSync('./packages/*/package.json').map(
  fn => readJSONSync(fn).name
)

export default {
  extends: ['@commitlint/config-angular'],
  rules: {
    // Cheatsheet: https://commitlint.js.org/#/reference-rules
    // Sweet Jesus why is disabling a rule syntax so verbose??
    'scope-enum': [2, 'always', packages],
    'header-max-length': [0, 'never', Infinity],
    'type-enum': [1, 'always', [...types.value(), 'chore']],
  },
}

// The default (lowest build target) transpilation settings.
{
  "$schema": "https://json.schemastore.org/swcrc",
  "sourceMaps": false,
  "module": {
    // To match the tsc output.
    "strictMode": false,
    "type": "commonjs",
    "noInterop": false
  },
  "jsc": {
    "externalHelpers": true,
    "target": "es5",
    "parser": {
      "syntax": "typescript",
      "tsx": true,
      "decorators": false,
      "dynamicImport": true
    },
    "transform": {
      "react": {
        "throwIfNamespace": false,
        "useBuiltins": false,
        "pragma": "React.createElement",
        "pragmaFrag": "React.Fragment"
      }
    },
    "keepClassNames": false
  }
}

{
  "auths": {
    "ghcr.io": {},
    "https://index.docker.io/v1/": {}
  },
  "credsStore": "desktop",
  "experimental": "disabled"
}

module.exports = {
  testEnvironment: 'node',
  verbose: true,
}

module.exports = {
  testEnvironment: 'node',
  transform: {
    '^.+\\.(t|j)sx?$': '@swc/jest',
  },
  verbose: true,
}

module.exports = function (config) {
  // Browsers to run on Sauce Labs
  // Check out https://saucelabs.com/platforms for all browser/OS combos
  const customLaunchers = {
    // Sauce Labs keeps failing to get a safari instance
    sl_safari: {
      base: 'SauceLabs',
      browserName: 'safari',
      version: '12',
    },
    sl_edge: {
      base: 'SauceLabs',
      browserName: 'MicrosoftEdge',
    },
    sl_chrome: {
      base: 'SauceLabs',
      browserName: 'chrome',
      version: '38', // https://polyfill-fastly.io/v3/supported-browsers/
    },
    sl_firefox: {
      base: 'SauceLabs',
      browserName: 'firefox',
      version: '40', // https://polyfill-fastly.io/v3/supported-browsers/
    },
    sl_ie_11: {
      base: 'SauceLabs',
      browserName: 'internet explorer',
      version: '11',
    },
  }

  config.set({
    basePath: '',
    frameworks: ['jasmine', 'jasmine-matchers'],
    files: ['**/bundled-karma-tests-*.test.bundled.js'],
    reporters: ['progress', 'saucelabs'],
    colors: true,
    concurrency: 5,
    sauceLabs: {
      testName: 'formatjs',
      build: process.env.GITHUB_RUN_ID,
      recordScreenshots: false,
      username: process.env.SAUCE_USERNAME,
      accessKey: process.env.SAUCE_ACCESS_KEY,
      // Must match with `.github/workflows/saucelabs.yml`
      connectOptions: {
        scproxyPort: 5757,
        logfile: 'sauce_connect.log',
      },
      public: 'public',
    },
    plugins: [
      'karma-chrome-launcher',
      'karma-jasmine-matchers',
      'karma-jasmine',
      'karma-sauce-launcher',
    ],
    // Increase timeout in case connection in CI is slow
    captureTimeout: 120000,
    customLaunchers,
    singleRun: true,
  })
}

{
  "registry": "https://registry.npmjs.org/",
  "version": "independent",
  "command": {
    "version": {
      "changelogIncludeCommitsClientLogin": " - by @%l",
      "conventionalCommits": true,
      "createRelease": "github",
      "exact": true,
      "ignoreChanges": ["**/tests/**", "**/*.md"],
      "message": "build: publish",
      "private": false
    },
    "run": {
      "stream": true
    },
    "publish": {
      "removePackageFields": ["devDependencies", "scripts"]
    }
  },
  "packages": ["packages/*"]
}

{
  "$schema": "https://docs.renovatebot.com/renovate-schema.json",
  "extends": ["config:recommended"],
  "ignorePaths": [
    "**/node_modules/**",
    "packages/react-intl/example-sandboxes/**"
  ],
  "packageRules": [
    {
      "description": "Automerge non-major updates",
      "matchUpdateTypes": ["minor", "patch"],
      "automerge": true
    }
  ]
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "target": "es6",
    "sourceMap": true
  }
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "target": "ESNext",
    "module": "ESNext",
    "moduleResolution": "Bundler"
  }
}

