  "extends": "./tsconfig.json",
  "compilerOptions": {
    "module": "ESNext",
    "moduleResolution": "Bundler"
  }
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "target": "ES2021"
  }
}
